(window.webpackJsonp=window.webpackJsonp||[]).push([[8],{"ur+X":function(t,e,a){"use strict";a.d(e,"a",(function(){return r}));var r=[{title:"LBL_HOME_CLAVEBEPASS_INTRO",body:[{title:"bepass.intro.button",body:"Crear clave BE Pass"},{title:"bepass.intro.link",body:"En otro momento"},{title:"bepass.intro.subtitle",body:"Es la nueva forma de autorizar tus operaciones desde tu celular, con la misma seguridad de siempre."},{title:"bepass.intro.title",body:"Crea tu clave BE Pass"}]},{title:"LBL_HOME_ERRORES",body:[{httpCode:200,errorCode:"BHT.MNF.0000",errorDesc:"OK",glosa:""},{httpCode:500,errorCode:"BHT.MNF.0001",errorDesc:"Error de bus",glosa:"Por el momento no es posible cargar los \xfaltimos movimientos de tu tarjeta.Por favor intentalo m\xe1s tarde."},{httpCode:400,errorCode:"BHT.MNF.0002",errorDesc:"Falta parametro RUT",glosa:"Por el momento no es posible cargar los \xfaltimos movimientos de tu tarjeta.Por favor intentalo m\xe1s tarde."},{httpCode:400,errorCode:"BHT.MNF.0003",errorDesc:"Falta parametro Digito Verificador",glosa:"Por el momento no es posible cargar los \xfaltimos movimientos de tu tarjeta.Por favor intentalo m\xe1s tarde."},{httpCode:400,errorCode:"BHT.MNF.0004",errorDesc:"Falta parametro nroOfuscado",glosa:"Por el momento no es posible cargar los \xfaltimos movimientos de tu tarjeta.Por favor intentalo m\xe1s tarde."},{httpCode:200,errorCode:"SINDEUDA",errorDesc:"Sin Deuda",icono:"bech_alert_circle",titulo:"Sin Deuda",glosa:"Tu tarjeta de cr\xe9dito no tiene deuda por pagar",boton:"Aceptar",link:"tc - detalle"},{httpCode:200,errorCode:"SINAVANCE",errorDesc:"Sin Avance",icono:"bech_alert_circle",titulo:"No es posible realizar avance",glosa:"Tu tarjeta de cr\xe9dito se encuentra sin cupo disponible para realizar avances",boton:"Aceptar",link:"tc - detalle"},{httpCode:200,errorCode:"BHA.DCA.0000",errorDesc:"",glosa:""},{httpCode:200,errorCode:"BHA.DCA.0001",errorDesc:"Falta parametro numero cuenta",glosa:"Por el momento no es posible cargar los \xfaltimos movimientos de tu cuenta.Por favor int\xe9ntalo m\xe1s tarde."},{httpCode:500,errorCode:"BHA.DCA.0012",errorDesc:"Error de bus",glosa:"Por el momento no es posible cargar los \xfaltimos movimientos de tu cuenta.Por favor intentalo m\xe1s tarde."},{httpCode:200,errorCode:"SINMOVTCR",errorDesc:"Sin Movimientos Tarjetas",glosa:"No hay movimientos disponibles en este periodo"},{httpCode:200,errorCode:"SINMOVAHO",errorDesc:"Sin Movimientos Ahorro",glosa:"No hay movimientos disponibles"},{httpCode:200,errorCode:"SINPAGO",errorDesc:"Sin Pagos",icono:"",titulo:"\xbfA\xfan no tienes una cuenta BancoEstado para operar ? ",glosa:"Solicita tu <b>CuentaRUT, Cuenta Corriente o Chequera Electr\xf3nica</b> en <b>www.bancoestado.cl</b> o en cualquier sucursal BancoEstado cercana.",boton:"Salir",link:""},{httpCode:200,errorCode:"SINDEUDATCR",errorDesc:"Sin Deudas Tarjetas",glosa:"No hay monto facturado para pagar"}]},{title:"LBL_HOME_PUBLICIDAD",body:{publicidad:[{link:"https://www.bancoestado.cl/imagenes/_campanas/corporativo/index.asp",imagen:"data:image/png;base64,"}]}},{title:"LABEL_HOME_MODAL_INFO1_BTN1",body:"Tomo conocimiento"},{title:"LABEL_HOME_MODAL_INFO1_IMG",body:"assets/img/alert-1.svg"},{title:"LABEL_HOME_MODAL_INFO1_SUBTITLE",body:"A partir del abono del retiro de fondos de tu AFP, suspenderemos los Pagos Autom\xe1ticos de Cuentas (PAC) Consumo, Hipotecario y Tarjetas durante 10 d\xedas seguidos"},{title:"LABEL_HOME_MODAL_INFO1_TITLE",body:"Informaci\xf3n importante"},{title:"LABEL_HOME_MODAL_INFO2_BTN1",body:"Abrir Cuenta"},{title:"LABEL_HOME_MODAL_INFO2_BTN2",body:"Cerrar"},{title:"LABEL_HOME_MODAL_INFO2_IMG",body:"assets/img/Group_4_2x.svg"},{title:"LABEL_HOME_MODAL_INFO2_SUBTITLE",body:"Abre una Cuenta Mi10 y resguarda tu retiro de AFP de cualquier cargo (PAC)"},{title:"LABEL_HOME_MODAL_INFO2_TITLE",body:"Mant\xe9n tu retiro de la AFP libre de cualquier cargo (PAC)"},{title:"LABEL_HOME_TXT_OFERTAHOME",body:'<div class="bech-campanas-container"><div class="bech-campanas-container__barralateral"></div><div class="bech-campanas-container__nombrecampana"><h4 class="bech-campanas-container__titulooferta">Cr\xe9dito Aprobado</h4><p class="bech-campanas-container__textobajada">Toma tu cr\xe9dito de consumo con abono inmediato de:</p></div><div class="bech-campanas-container__montocampana"><h3 class="bech-campanas-container__montooferta">$${MONTO?number}</h3><button class="bech-campanas-container__button">Contratar</button></div></div><input type="hidden" id="URL_APP" name="URL_APP" value="/apps/creditopersona/offer">'},{title:"LABEL_HOME_TXT_OFERTASALDO",body:'<div class="bech-campanas-container"><div class="bech-campanas-container__barralateral"></div><div class="bech-campanas-container__nombrecampana"><h4 class="bech-campanas-container__titulooferta">Cr\xe9dito Aprobado</h4><p class="bech-campanas-container__textobajada">Toma tu cr\xe9dito de consumo con abono inmediato de:</p></div><div class="bech-campanas-container__montocampana"><h3 class="bech-campanas-container__montooferta">$${MONTO?number}</h3><button class="bech-campanas-container__button">Contratar</button></div></div><input type="hidden" id="URL_APP" name="URL_APP" value="/apps/creditopersona/offer">'},{title:"LABEL_MENUMAS_INT_POLITICASDEUSO",body:"Pol\xedticas de uso"},{title:"LABEL_MENUMAS_INT_POLITICASDEUSODETALLE",body:'<h5><b>ACUERDO DE USO DE LA APLICACI\xd3N</b></h5>\r\n\r\n\t\t\t\t<p>El presente Acuerdo de Uso (en adelante indistintamente \u201ct\xe9rminos y condiciones de uso\u201d) se refiere al acuerdo\r\n\t\t\t\t\tentre el usuario y el Banco del Estado de Chile (en adelante indistintamente \u201cel Banco\u201d o \u201cBancoEstado\u201d) y\r\n\t\t\t\t\taplican al uso de la Aplicaci\xf3n BancoEstado, sus productos, servicios y cualquier funcionalidad, tecnolog\xeda o\r\n\t\t\t\t\tcaracter\xedstica ofrecida por el Banco a trav\xe9s de dicha Aplicaci\xf3n. Los servicios ofrecidos a trav\xe9s de la\r\n\t\t\t\t\tAplicaci\xf3n se encuentran sujetos y limitados a la aceptaci\xf3n y debido cumplimiento por parte del usuario de estos\r\n\t\t\t\t\tt\xe9rminos y condiciones de uso y la seguridad de la informaci\xf3n de BancoEstado para la Aplicaci\xf3n, las que se\r\n\t\t\t\t\tencuentran igualmente disponibles en la Aplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p><b>A. ACUERDOS CON TERCERAS PARTES</b><br>\r\n\t\t\t\t\tEl usuario conoce y acepta que este acuerdo s\xf3lo impone deberes y obligaciones entre las partes, excluyendo a\r\n\t\t\t\t\tterceras partes de los efectos de estos t\xe9rminos y condiciones, tales como las empresas de telecomunicaciones,\r\n\t\t\t\t\tproveedores de internet, empresas distribuidoras de software o de tecnolog\xeda como Apple, Google\xae, y que\r\n\t\t\t\t\tBancoEstado es solamente responsable por los servicios prestados a trav\xe9s de la Aplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p><b>B. T\xc9RMINOS DEL SERVICIO</b><br>\r\n\t\t\t\t\tLa Aplicaci\xf3n de BancoEstado es un canal de atenci\xf3n y comunicaci\xf3n financiera digital que facilita la\r\n\t\t\t\t\tinteracci\xf3n de los clientes de BancoEstado con su entorno para satisfacer sus necesidades financieras de forma\r\n\t\t\t\t\tsegura y confiable a trav\xe9s de sus productos bancarios.</p>\r\n\r\n\t\t\t\t<p>En la Aplicaci\xf3n los clientes del Banco pueden tener acceso a informaci\xf3n relativa a los productos y servicios\r\n\t\t\t\t\tbancarios contratados con el Banco, seg\xfan la disponibilidad establecida por dicha instituci\xf3n, e interactuar\r\n\t\t\t\t\tdirectamente desde su dispositivo m\xf3vil con otros clientes del Banco debidamente inscritos y registrados en la\r\n\t\t\t\t\tAplicaci\xf3n.<br><br>\r\n\t\t\t\t\tSe entiende como usuario de la Aplicaci\xf3n de BancoEstado a todos los clientes de BancoEstado que cumplan con los\r\n\t\t\t\t\trequisitos m\xednimos establecidos por el Banco, que sean titulares de CuentaRUT, Cuenta Corriente, Chequera\r\n\t\t\t\t\tElectr\xf3nica o Cuenta de Ahorro de BancoEstado, que hayan descargado la Aplicaci\xf3n, que se hayan inscrito seg\xfan el\r\n\t\t\t\t\tprocedimiento establecido en dicha Aplicaci\xf3n y que hayan aceptado estos t\xe9rminos y condiciones de uso.</p>\r\n\r\n\t\t\t\t<p>Al otorgar su consentimiento expreso al cumplimiento de estos t\xe9rminos y condiciones de uso, el usuario\r\n\t\t\t\t\tconsiente al uso responsable de los servicios prestados por BancoEstado a trav\xe9s de esta Aplicaci\xf3n y, a su vez,\r\n\t\t\t\t\tdeclara conocer las responsabilidades y obligaciones que se derivan de las transacciones y operaciones que se\r\n\t\t\t\t\trealicen a trav\xe9s de la Aplicaci\xf3n, ya sea entre sus cuentas o en interacci\xf3n con otros usuarios de la\r\n\t\t\t\t\tAplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p>Asimismo, el usuario autoriza a BancoEstado a mostrar en la Aplicaci\xf3n la informaci\xf3n necesaria para\r\n\t\t\t\t\tidentificar al usuario en la Aplicaci\xf3n y permitir que se visualice informaci\xf3n no sensible por parte de otros\r\n\t\t\t\t\tusuarios de la Aplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p><b>C. REQUISITOS DE ACCESO A LA APLICACI\xd3N</b><br>\r\n\t\t\t\t\tPueden acceder a la Aplicaci\xf3n aquellos clientes personas naturales con y sin giro comercial, que sean titulares\r\n\t\t\t\t\tde CuentaRUT, Cuenta Corriente, Chequera Electr\xf3nica o Cuenta de Ahorro de BancoEstado, que cumplan los\r\n\t\t\t\t\trequisitos solicitados en la inscripci\xf3n y que hayan aceptado estos t\xe9rminos y condiciones de uso de la\r\n\t\t\t\t\tAplicaci\xf3n.<br><br>\r\n\t\t\t\t\tBancoEstado se reserva el derecho a denegar acceso a aquellos usuarios que no cumplan con los requisitos m\xednimos\r\n\t\t\t\t\to aquellos cuya informaci\xf3n no permitan la correcta y debida identificaci\xf3n de los usuarios de la Aplicaci\xf3n.\r\n\t\t\t\t\tPara estos efectos, BancoEstado requerir\xe1, al momento del registro, los datos relevantes que permitan la correcta\r\n\t\t\t\t\tidentificaci\xf3n de los usuarios, no permitiendo la existencia de registros an\xf3nimos. Para dichos efectos,\r\n\t\t\t\t\tBancoEstado se reservar\xe1 el derecho a solicitar en cualquier momento datos que comprueben la veracidad de dicha\r\n\t\t\t\t\tinformaci\xf3n.</p>\r\n\r\n\r\n\t\t\t\t<p><b>D. DESCARGA DE LA APLICACI\xd3N</b><br>\r\n\t\t\t\t\tLa Aplicaci\xf3n se puede descargar desde las tiendas Google Play y Aplicaci\xf3n Store para sistemas operativos\r\n\t\t\t\t\tAndroid e IOS respectivamente, permitiendo a cualquier persona que posea conexi\xf3n a internet y un tel\xe9fono m\xf3vil\r\n\t\t\t\t\tcompatible con la aplicaci\xf3n, acceder y utilizar la Aplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p><b>E. TRATAMIENTO DE DATOS</b><br>\r\n\t\t\t\t\tLos datos personales que los Usuarios proporcionen al Banco a trav\xe9s de la Aplicaci\xf3n se encuentran resguardados\r\n\t\t\t\t\tpor los deberes de confidencialidad y reserva contemplados en la ley y en las obligaciones contractuales a las\r\n\t\t\t\t\tque est\xe1n sujetas las operaciones bancarias entre el Banco y sus clientes. Dichos datos s\xf3lo ser\xe1n utilizados\r\n\t\t\t\t\tpara los fines propios del Banco y su tratamiento se realizar\xe1 siempre velando por el debido cumplimiento de la\r\n\t\t\t\t\tLey de Protecci\xf3n de los Derechos de los Consumidores, la Ley de Protecci\xf3n de Datos de Car\xe1cter Personal y\r\n\t\t\t\t\tcualquier otra norma que establezca deberes u obligaciones sobre el tratamiento de datos aplicables al Banco y\r\n\t\t\t\t\tsus clientes.</p>\r\n\r\n\t\t\t\t<p>Los datos que se solicitan en esta Aplicaci\xf3n y que el usuario autoriza a compartir con el Banco son los\r\n\t\t\t\t\tsiguientes:</p>\r\n\t\t\t\t<p>Datos de Usuario para Registrarse:</p>\r\n\t\t\t\t<ul>\r\n\t\t\t\t\t<li>N\xfamero de RUT</li>\r\n\t\t\t\t\t<li>Nombre completo</li>\r\n\t\t\t\t\t<li>Clave Internet o de Cajero Autom\xe1tico de BancoEstado</li>\r\n\t\t\t\t\t<li>Clave Tarjeta de Transferencias, T\xf3ken o C\xf3digo enviado a su n\xfamero celular o correo electr\xf3nico registrado\r\n\t\t\t\t\t\tpor el cliente en el Banco</li>\r\n\t\t\t\t\t<li>Nombre corto opcional (alias)</li>\r\n\t\t\t\t\t<li>N\xb0 de tel\xe9fono m\xf3vil</li>\r\n\t\t\t\t\t<li>Correo electr\xf3nico</li>\r\n\t\t\t\t\t<li>Fotograf\xeda (opcional)</li>\r\n\t\t\t\t\t<li>Acceso a contactos del tel\xe9fono (opcional)</li>\r\n\t\t\t\t\t<li>Tipo de dispositivo y navegador por el cual est\xe1 interactuando con la aplicaci\xf3n</li>\r\n\t\t\t\t\t<li>Acceso a datos biom\xe9tricos como huella dactilar (opcional)</li>\r\n\t\t\t\t\t<li>Creaci\xf3n de Clave Local para acceso a la Aplicaci\xf3n</li>\r\n\t\t\t\t</ul>\r\n\r\n\t\t\t\t<p>Datos de Usuario para Iniciar Sesi\xf3n:<br>\r\n\t\t\t\t\t<ul>\r\n\t\t\t\t\t<li>Clave local para acceso a la Aplicaci\xf3n o acceso a la huella digital (dependiendo de la tecnolog\xeda tel\xe9fono).</li>\r\n\t\t\t\t\t</ul>\r\n\r\n\t\t\t\t<p><b>F. FUNCIONALIDADES DE LA APLICACI\xd3N</b><br>\r\n\t\t\t\t\tLa Aplicaci\xf3n tendr\xe1 las siguientes funcionalidades y caracter\xedsticas:</p>\r\n\t\t\t\t<ul>\r\n\t\t\t\t\t<li>Personalizar el perfil personal, pudiendo elegir una foto como avatar y un nombre corto (alias) de manera\r\n\t\t\t\t\t\topcional. Dicho avatar ser\xe1 visto por los otros participantes de la Aplicaci\xf3n.</li>\r\n\t\t\t\t\t<li>La Aplicaci\xf3n dispondr\xe1 de un c\xf3digo QR \xfanico y seguro el cual est\xe1 asociado al RUT del usuario y que se\r\n\t\t\t\t\t\tgenera autom\xe1ticamente en el proceso de registro. Este c\xf3digo es personal y facilita el contacto con personas\r\n\t\t\t\t\t\tde la Aplicaci\xf3n. El usuario podr\xe1 compartir este c\xf3digo, con el cual permitir\xe1 efectuar operaciones bancarias,\r\n\t\t\t\t\t\ttales como transferencias electr\xf3nicas de fondo con otros participantes de la Aplicaci\xf3n sin tener que guardar\r\n\t\t\t\t\t\tdestinatarios. Este c\xf3digo QR podr\xe1 ser impreso en forma f\xedsica o utilizarlo en forma digital.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 consultar los saldos disponibles y \xfaltimos movimientos de su CuentaRUT, Cuenta Corriente,\r\n\t\t\t\t\t\tChequera Electr\xf3nica, Cuenta de Ahorro y Tarjeta de Cr\xe9dito BancoEstado.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 realizar transferencias electr\xf3nicas de fondos entre sus cuentas propias, cuentas\r\n\t\t\t\t\t\tpertenecientes a otros usuarios de la Aplicaci\xf3n, y a terceros que no est\xe9n en \xe9sta, siguiendo los\r\n\t\t\t\t\t\tprocedimientos aplicables a otros canales de BancoEstado.</li>\r\n\t\t\t\t\t<li>Tambi\xe9n el usuario podr\xe1 transferir a una CuentaRUT, Cuenta Corriente o Chequera Electr\xf3nica indicando solo\r\n\t\t\t\t\t\tel RUT del destinatario y el monto de la transferencia, siempre y cuando se sigan los procedimientos de\r\n\t\t\t\t\t\tseguridad y l\xedmites de operaci\xf3n establecidos por el Banco.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 visualizar informaci\xf3n b\xe1sica de otros usuarios inscritos en la App, a efectos de utilizar\r\n\t\t\t\t\t\totras funcionalidades o realizar operaciones bancarias y financieras permitidas entre miembros inscritos en\r\n\t\t\t\t\t\tdicha App.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 realizar el pago de sus cuentas de servicios previamente inscritas, tales como empresas\r\n\t\t\t\t\t\tproveedoras de luz, agua, gas, etc.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 realizar recargas de fondos de sus Tarjeta BIP (BIP, TNE, TAM y su CuentaRUT siempre que\r\n\t\t\t\t\t\t\xe9sta se encuentre habilitada para ser usada como tarjeta BIP) a trav\xe9s de la opci\xf3n \u201cRecarga BIP\u201d de la\r\n\t\t\t\t\t\tAplicaci\xf3n. El usuario podr\xe1 agregar Tarjetas BIP (BIP, TNE y TAM) como frecuentes para poder recargarlas,\r\n\t\t\t\t\t\tindicando el n\xfamero de tarjeta y la informaci\xf3n necesaria para identificar dicha Tarjeta. Si el usuario decide\r\n\t\t\t\t\t\teliminar una Tarjeta BIP desde su listado de tarjetas frecuentes en la Aplicaci\xf3n, esto no afecta el normal\r\n\t\t\t\t\t\tfuncionamiento de su tarjeta y el saldo disponible permanecer\xe1 intacto, por lo que podr\xe1 seguir operando con\r\n\t\t\t\t\t\tella en el transporte p\xfablico.</li>\r\n\t\t\t\t\t<li>Las recargas de Tarjetas BIP realizadas en la Aplicaci\xf3n deber\xe1n activarse en cualquier t\xf3tem o infobip\r\n\t\t\t\t\t\tdisponible en la red de sucursales BancoEstado, de Metro u otro lugar donde se encuentren habilitados.</li>\r\n\t\t\t\t\t<li>Para revisar la informaci\xf3n de saldo disponible de la Tarjeta BIP, el usuario debe utilizar los mecanismos\r\n\t\t\t\t\t\tprevistos por Metro. BancoEstado no cuenta con los medios para disponer de dicha informaci\xf3n a sus clientes.</li>\r\n\t\t\t\t\t<li>Las recargas de Tarjetas BIP se realizan bajo exclusiva responsabilidad del usuario en la Aplicaci\xf3n.</li>\r\n\t\t\t\t\t<li>El usuario ser\xe1 responsable de ingresar los datos correctos que permitan efectuar la transacci\xf3n en los\r\n\t\t\t\t\t\tmontos y condiciones solicitados. BancoEstado no ser\xe1 responsable por errores en digitaci\xf3n o ingreso de\r\n\t\t\t\t\t\tinformaci\xf3n en la realizaci\xf3n de transacciones.</li>\r\n\t\t\t\t\t<li>La funcionalidad de recargas de Tarjetas BIP se encuentra sujeta a disponibilidad por parte de METRO S.A. y\r\n\t\t\t\t\t\tcualquier reclamo, sugerencia u observaci\xf3n debe ser canalizada a trav\xe9s de los medios de comunicaci\xf3n\r\n\t\t\t\t\t\tdispuestos por dicha empresa para tales efectos. BancoEstado no se hace responsable por el funcionamiento de la\r\n\t\t\t\t\t\tred de transporte ni el uso de la CuentaRUT o la Aplicaci\xf3n como Tarjeta BIP.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 realizar el pago de sus productos BancoEstado directamente en la Aplicaci\xf3n, en este caso\r\n\t\t\t\t\t\tpodr\xe1 pagar el cupo utilizado de su L\xednea de Cr\xe9dito con cargo a su Cuenta Corriente o Chequera Electr\xf3nica\r\n\t\t\t\t\t\tseg\xfan corresponda, como del pago de cuotas de su Cr\xe9dito de Consumo o Universitario o del dividendo de su\r\n\t\t\t\t\t\tCr\xe9dito Hipotecario con cargo a su Cuenta Corriente, Chequera Electr\xf3nica o CuentaRUT.</li>\r\n\t\t\t\t\t<li>Revisar las notificaciones o alertas de Transferencias, Pagos de Servicios, Recarga de Tarjeta Bip, Pago de\r\n\t\t\t\t\t\tProductos y de otros productos activos y vigentes en la Aplicaci\xf3n.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 realizar bloqueo y desbloqueo temporal de sus tarjetas de CuentaRUT, Cuenta Corriente o\r\n\t\t\t\t\t\tChequera Electr\xf3nica en cualquier momento, o bien realizar bloqueo por robo, en cuyo caso las tarjetas se\r\n\t\t\t\t\t\teliminar\xe1n definitivamente. El usuario deber\xe1 seguir los protocolos de seguridad y procedimientos dispuestos\r\n\t\t\t\t\t\tpor BancoEstado para tales efectos.</li>\r\n\t\t\t\t\t<li>La Aplicaci\xf3n puede estar disponible s\xf3lo para un usuario y un tel\xe9fono celular a la vez. Al registrar un\r\n\t\t\t\t\t\tnuevo dispositivo, el dispositivo anterior quedar\xe1 bloqueado para operar en la Aplicaci\xf3n.</li>\r\n\t\t\t\t\t<li>El usuario podr\xe1 visualizar la informaci\xf3n de otros usuarios inscritos en la Aplicaci\xf3n, a efectos de\r\n\t\t\t\t\t\tutilizar otras funcionalidades o realizar operaciones bancarias y financieras permitidas en dicha Aplicaci\xf3n.</li>\r\n\t\t\t\t</ul>\r\n\r\n\t\t\t\t<p>BancoEstado, a su s\xf3lo arbitrio, podr\xe1 modificar en cualquier momento y sin necesidad de justificaci\xf3n alguna\r\n\t\t\t\t\tlas funcionalidades de la Aplicaci\xf3n.</p>\r\n\r\n\r\n\t\t\t\t<p><b>G. PERMISOS DE ACCESO</b><br>\r\n\t\t\t\t\tLa Aplicaci\xf3n requiere acceso a las siguientes funciones contenidas en el dispositivo m\xf3vil:</p>\r\n\t\t\t\t<ul>\r\n\t\t\t\t\t<li>Galer\xeda de im\xe1genes</li>\r\n\t\t\t\t\t<li>C\xe1mara de fotos y videos</li>\r\n\t\t\t\t\t<li>Uso de conexi\xf3n a datos del dispositivo</li>\r\n\t\t\t\t\t<li>Agenda de contactos contenida en el dispositivo</li>\r\n\t\t\t\t\t<li>Informaci\xf3n derivada de la funcionalidad GPS del dispositivo</li>\r\n\t\t\t\t\t<li>El tipo de dispositivo y navegador por el cual est\xe1 interactuando con la aplicaci\xf3n</li>\r\n\t\t\t\t\t<li>Acceso a datos biom\xe9tricos como huella (opcional) \u2013 no queda registro en BancoEstado</li>\r\n\t\t\t\t</ul>\r\n\r\n\t\t\t\t<p>El usuario otorga su autorizaci\xf3n al acceso de la Aplicaci\xf3n a las funciones antes mencionadas del dispositivo\r\n\t\t\t\t\tm\xf3vil, a trav\xe9s del mecanismo de descarga de la Aplicaci\xf3n o en el procedimiento de registro en la misma. Por el\r\n\t\t\t\t\tcontrario, la falta de autorizaci\xf3n del usuario impide que \xe9ste pueda operar de forma \xf3ptima con todas las\r\n\t\t\t\t\tcapacidades ofrecidas en la Aplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p>Una vez otorgada la autorizaci\xf3n de acceso, el usuario podr\xe1 visualizar a los contactos de la Aplicaci\xf3n y a\r\n\t\t\t\t\tsu vez, el usuario ser\xe1 visible para otros usuarios de la Aplicaci\xf3n.</p>\r\n\r\n\r\n\t\t\t\t<p><b>H. ACTUALIZACIONES DE LA APLICACI\xd3N</b><br>\r\n\t\t\t\t\tEl Banco podr\xe1 modificar la Aplicaci\xf3n en cualquier momento y a su sola discreci\xf3n, incluyendo la informaci\xf3n\r\n\t\t\t\t\tdisponible en \xe9sta, los servicios que en \xe9sta se ofrecen, las operaciones que permite efectuar y tambi\xe9n estos\r\n\t\t\t\t\tt\xe9rminos y condiciones de uso. Las actualizaciones de la Aplicaci\xf3n ser\xe1n debidamente informadas en el proceso\r\n\t\t\t\t\tde actualizaci\xf3n de la versi\xf3n de la Aplicaci\xf3n, sin perjuicio de la utilizaci\xf3n de otros medios de\r\n\t\t\t\t\tcomunicaci\xf3n para tales efectos. En caso de ser solicitado por el Banco, el usuario deber\xe1 aceptar los nuevos\r\n\t\t\t\t\tt\xe9rminos y condiciones dispuestos por BancoEstado para continuar utilizando la Aplicaci\xf3n.</p>\r\n\r\n\t\t\t\t<p><b>I. USO DE COOKIES</b><br>\r\n\t\t\t\t\tEsta Aplicaci\xf3n utiliza cookies para facilitar la navegaci\xf3n y preferencias del usuario. Una cookie es un\r\n\t\t\t\t\tpeque\xf1o archivo con informaci\xf3n que se almacena en el navegador cuando el usuario visita un sitio web y en el\r\n\t\t\t\t\tque se suelen guardar las configuraciones y preferencias del usuario.</p>\r\n\r\n\t\t\t\t<p><b>J. PROPIEDAD INTELECTUAL</b><br>\r\n\t\t\t\t\tLos usuarios deben utilizar la Aplicaci\xf3n de acuerdo con estos t\xe9rminos y condiciones de uso y con pleno\r\n\t\t\t\t\trespeto a la ley y la normativa vigente, tanto a las operaciones bancarias como al acceso a informaci\xf3n de los\r\n\t\t\t\t\tclientes.</p>\r\n\r\n\t\t\t\t<p>Esta Aplicaci\xf3n y la informaci\xf3n que contiene se encuentran amparados por la Ley N\xb0 17.336 sobre Propiedad\r\n\t\t\t\t\tIntelectual, por lo tanto se proh\xedbe cualquier tipo de reproducci\xf3n total o parcial de los contenidos\r\n\t\t\t\t\tdisponibles en la Aplicaci\xf3n. BancoEstado se reserva el derecho a interponer acciones legales para perseguir\r\n\t\t\t\t\tcualquier uso contrario a estos t\xe9rminos y condiciones de uso, a las leyes vigentes y la normativa aplicable y,\r\n\t\t\t\t\tasimismo, a exigir el resarcimiento de cualquier da\xf1o o perjuicio contra el Banco realizado a trav\xe9s de la\r\n\t\t\t\t\tAplicaci\xf3n o utilizando alguna de sus funcionalidades de forma maliciosa.</p>\r\n\r\n\t\t\t\t<p>La marca BancoEstado y todos sus logos asociados, productos y servicios descritos en la Aplicaci\xf3n son\r\n\t\t\t\t\tmarcas registradas del Banco del Estado de Chile, de conformidad a la legislaci\xf3n nacional e internacional en\r\n\t\t\t\t\tmateria de propiedad intelectual. Las marcas y logos de compa\xf1\xedas ajenas a BancoEstado y que se muestran en la\r\n\t\t\t\t\tAplicaci\xf3n, son de exclusivo uso de sus propietarios y licenciatarios. El uso de dichas marcas y logos se\r\n\t\t\t\t\tencuentra sujeto a la autorizaci\xf3n de sus propietarios y licenciatarios.</p>\r\n\r\n\t\t\t\t<p>El incumplimiento o infracci\xf3n a alguno de los aspectos mencionados en estos t\xe9rminos y condiciones de uso\r\n\t\t\t\t\tconllevar\xe1 el cese de los servicios, sin perjuicio de las acciones legales que el Banco pueda perseguir en cada\r\n\t\t\t\t\tcaso. BancoEstado se reserva el derecho de investigar el uso del servicio por parte del usuario, sujet\xe1ndose a\r\n\t\t\t\t\tla seguridad de la informaci\xf3n y las normas sobre tratamiento de datos personales, con el fin de determinar si\r\n\t\t\t\t\texiste alguna infracci\xf3n a estos t\xe9rminos y condiciones de uso o para efectos de verificar el cumplimiento de\r\n\t\t\t\t\tla ley y normativa aplicable por parte del usuario.</p>\r\n\r\n\t\t\t\t<p><b>K. RESPONSABILIDAD DEL USUARIO</b><br>\r\n\t\t\t\t\tLa utilizaci\xf3n de internet est\xe1 expuesta a la intervenci\xf3n maliciosa o negligente de terceros, la que puede\r\n\t\t\t\t\tocasionar da\xf1os al usuario o a sus equipos computacionales, situaci\xf3n que bajo ninguna circunstancia ser\xe1\r\n\t\t\t\t\timputable al Banco. En consecuencia, habiendo tomado conocimiento de este hecho y optado voluntariamente por\r\n\t\t\t\t\toperar en la Aplicaci\xf3n, el usuario asume bajo su responsabilidad y cargo los riesgos de los eventuales da\xf1os y\r\n\t\t\t\t\tperjuicios a los que se puedan ver expuesto.</p>\r\n\r\n\t\t\t\t<p>En la Aplicaci\xf3n se han incorporado hiperv\xednculos que permiten acceder a sitios web de terceros, considerando\r\n\t\t\t\t\tque los servicios, informaci\xf3n u operaciones disponibles en ellos pueden resultar de utilidad para el usuario.\r\n\t\t\t\t\t\xc9ste acceder\xe1 a ellos en las condiciones que dichos sitios establezcan y bajo su propia responsabilidad. No\r\n\t\t\t\t\tobstante, el Banco ejecutar\xe1 las instrucciones comunicadas desde aquellos sitios con los que haya celebrado\r\n\t\t\t\t\tacuerdos de colaboraci\xf3n y operaci\xf3n que permitan utilizar sus propios productos.</p>\r\n\r\n\t\t\t\t<p><b>L. CANCELACI\xd3N Y SUSPENSI\xd3N</b><br>\r\n\t\t\t\t\tBancoEstado podr\xe1 a su sola discreci\xf3n, en cualquier momento y sin indicaci\xf3n de motivo alguno, dar por\r\n\t\t\t\t\tfinalizado los servicios entregados en esta Aplicaci\xf3n, en cuyo caso estos t\xe9rminos y condiciones de uso\r\n\t\t\t\t\tquedar\xe1n sin efecto alguno.</p>\r\n\r\n\t\t\t\t<p>El usuario declara que las transacciones que realizar\xe1 en esta Aplicaci\xf3n son de origen l\xedcito y s\xf3lo\r\n\t\t\t\t\tprovienen de su actividad econ\xf3mica. Adem\xe1s declara que no podr\xe1 registrar literatura e im\xe1genes maliciosas en\r\n\t\t\t\t\tsu perfil. BancoEstado se reserva su derecho a bloquear el acceso temporal o permanentemente a aquellos\r\n\t\t\t\t\tclientes que hagan mal uso de las funcionalidades, utilicen sus funciones para cometer il\xedcitos o da\xf1ar la\r\n\t\t\t\t\tpropiedad p\xfablica o privada, incorporen mensajes ofensivos, constitutivos del delito de amenazas, que inciten\r\n\t\t\t\t\tal odio o que busquen denostar la imagen de BancoEstado y sus empresas filiales y sociedades de apoyo al giro o\r\n\t\t\t\t\tque incorporen im\xe1genes ofensivas, que formen parte de la comisi\xf3n de un delito o que sean utilizadas para\r\n\t\t\t\t\tdenostar o perjudicar directa o indirectamente a un usuario de la Aplicaci\xf3n, al Banco, sus empresas filiales o\r\n\t\t\t\t\tsus sociedades de apoyo al giro.</p>\r\n\r\n\t\t\t\t<p>Para prevenir usos indebidos o fraudulentos o proteger el inter\xe9s del cliente, BancoEstado podr\xe1 monitorear,\r\n\t\t\t\t\tauditar o investigar permanentemente la forma en que se utilicen los servicios de la Aplicaci\xf3n por parte del\r\n\t\t\t\t\tcliente.</p>\r\n\r\n\t\t\t\t<p><b>M. ENCRIPTACI\xd3N</b><br>\r\n\t\t\t\t\tEn cada oportunidad que las operaciones requieran mantener la privacidad de la informaci\xf3n que circula entre el\r\n\t\t\t\t\tdispositivo del usuario y el servidor web, se solicitar\xe1 la autenticaci\xf3n del usuario y se dispondr\xe1 de un\r\n\t\t\t\t\tambiente seguro usando protocolos estandarizados de encriptaci\xf3n (SSL) usados por la mayor\xeda de las empresas\r\n\t\t\t\t\tque operan en internet.</p>\r\n\r\n\t\t\t\t<p><b>N. RECOMENDACIONES DE SEGURIDAD</b><br>\r\n\t\t\t\t\tEn atenci\xf3n al uso seguro de los servicios ofrecidos por BancoEstado a trav\xe9s de la Aplicaci\xf3n, se sugiere al\r\n\t\t\t\t\tusuario seguir las siguientes recomendaciones:</p>\r\n\r\n\t\t\t\t<ol>\r\n\t\t\t\t\t<li>La clave que se requiere para esta Aplicaci\xf3n no se refiere a la clave de acceso a cuentas y otros\r\n\t\t\t\t\t\tproductos y servicios que cada cliente pueda tener en este u otros bancos, sino que a una clave espec\xedfica\r\n\t\t\t\t\t\tpara acceder a la Aplicaci\xf3n. Se recomienda usar una clave diferente a aquella utilizada para otros servicios\r\n\t\t\t\t\t\to cuentas bancarias.</li>\r\n\t\t\t\t\t<li>Recomendaciones para la creaci\xf3n de claves:</li>\r\n\t\t\t\t\t<ul>\r\n\t\t\t\t\t\t<li>Utilizar c\xf3digos secretos no triviales o dif\xedciles de adivinar.</li>\r\n\t\t\t\t\t\t<li>Evitar el uso de claves "obvias" como son los d\xedgitos de tu RUT, a\xf1os de nacimiento o tus n\xfameros\r\n\t\t\t\t\t\t\ttelef\xf3nico.</li>\r\n\t\t\t\t\t\t<li>No usar secuencias f\xe1ciles de reproducir tales como 1234, 1111, etc.</li>\r\n\t\t\t\t\t\t<li>No usar repetici\xf3n de tres n\xfameros seguidos como por ejemplo 333X o X111.</li>\r\n\t\t\t\t\t\t<li>No usar secuencia de tres n\xfameros como 1237 o 3218.</li>\r\n\t\t\t\t\t\t<li>Evitar la coincidencia con claves usadas anteriormente en BancoEstado.</li>\r\n\t\t\t\t\t\t<li>La responsabilidad del uso seguro de las claves de acceso a medios automatizados es exclusiva del usuario.</li>\r\n\t\t\t\t\t</ul>\r\n\t\t\t\t\t<li>Cuidar la privacidad de su clave secreta, por ning\xfan motivo se debe compartir con terceros.</li>\r\n\t\t\t\t\t<li>Cambiar peri\xf3dicamente los c\xf3digos personales de identificaci\xf3n (PIN) y utilizar diferentes c\xf3digos\r\n\t\t\t\t\t\tsecretos para los servicios del banco que lo requieran.</li>\r\n\t\t\t\t\t<li>Memorizar su clave secreta, no llevar consigo anotaciones en las que aparezca</li>\r\n\t\t\t\t</ol>\r\n\r\n\t\t\t\t<p>El usuario es el responsable de proteger sus productos y servicios contratados con BancoEstado. BancoEstado\r\n\t\t\t\t\tno ser\xe1 responsable de cualquier p\xe9rdida o da\xf1o derivados de \xe9sta.</p>\r\n\r\n\t\t\t\t<p>El usuario se obliga a notificar de inmediato a BancoEstado en caso de cualquier uso no autorizado de su\r\n\t\t\t\t\tcuenta de que tenga conocimiento o cualquier vulneraci\xf3n a la seguridad de la Aplicaci\xf3n. El usuario podr\xe1\r\n\t\t\t\t\tcomunicarse con el Banco a trav\xe9s de cualquiera de los canales de atenci\xf3n establecidos tanto de forma\r\n\t\t\t\t\tpresencial como digital o remota.</p>\r\n\r\n\r\n\t\t\t\t<p><b>\xd1. LEY APLICABLE Y JURISDICCI\xd3N</b><br>\r\n\t\t\t\t\tCualquier conflicto que se genere con motivo de la utilizaci\xf3n de la informaci\xf3n, los servicios o la\r\n\t\t\t\t\trealizaci\xf3n de operaciones disponibles por parte del usuario a trav\xe9s de la Aplicaci\xf3n ser\xe1 resuelto en\r\n\t\t\t\t\tconformidad con la legislaci\xf3n chilena vigente y ser\xe1n resueltas por los tribunales ordinarios de justicia de\r\n\t\t\t\t\tla Rep\xfablica de Chile.</p>\r\n\r\n\t\t\t\t<p><b>O. DISPONIBILIDAD DE ACCESO</b><br>\r\n\t\t\t\t\tBancoEstado podr\xe1 suspender por razones justificadas y temporalmente la disponibilidad de acceso a los\r\n\t\t\t\t\tServicios o establecer un horario distinto, informando dicha situaci\xf3n a los usuarios.</p>\r\n\r\n\t\t\t\t<p><b>P. TARIFAS</b><br>\r\n\t\t\t\t\tLos servicios de la Aplicaci\xf3n se encuentran sujetos a las tarifas y comisiones aplicables a los productos y\r\n\t\t\t\t\tservicios financieros contratados por el usuario con BancoEstado, tales como las comisiones pactadas en el\r\n\t\t\t\t\tContrato de Apertura de CuentaRUT, Cuenta Corriente, Chequera Electr\xf3nica, Cuenta de Ahorro y Tarjeta de\r\n\t\t\t\t\tCr\xe9dito BancoEstado. El uso de la Aplicaci\xf3n no est\xe1 sujeto a cargos adicionales por parte de BancoEstado.</p>\r\n\r\n\t\t\t\t<p><b>Q. ACTIVIDADES PROHIBIDAS</b><br>\r\n\t\t\t\t\tEst\xe1 estrictamente prohibido realizar las siguientes acciones:</p>\r\n\t\t\t\t<ul>\r\n\t\t\t\t\t<li>Compartir informaci\xf3n de sus contactos sin su consentimiento.</li>\r\n\t\t\t\t\t<li>Incurrir en conductas inapropiadas o constitutivas de delito en contra de los dem\xe1s usuarios de la\r\n\t\t\t\t\t\tAplicaci\xf3n, BancoEstado, sus empresas filiales, sus sociedades de apoyo al giro y, en general, en contra de\r\n\t\t\t\t\t\tsus funcionarios o trabajadores.</li>\r\n\t\t\t\t\t<li>Intervenci\xf3n ilegal en la Aplicaci\xf3n.</li>\r\n\t\t\t\t\t<li>Suplantaci\xf3n de identidad de cualquier usuario o no usuario de la Aplicaci\xf3n.</li>\r\n\t\t\t\t\t<li>Realizar actos constitutivos al delito de estafa y fraude.</li>\r\n\t\t\t\t\t<li>Utilizar la Aplicaci\xf3n para realizar operaciones sancionadas por la legislaci\xf3n nacional o internacional\r\n\t\t\t\t\t\tsobre lavado de dinero y prevenci\xf3n del financiamiento del terrorismo.</li>\r\n\t\t\t\t</ul>\r\n\t\t\t\t<p>En caso de no cumplir con lo expuesto, BancoEstado tiene el derecho de bloquear el acceso a la Aplicaci\xf3n.</p>'},{title:"LABEL_MENUMAS_INT_TRANSFIEREYRECIBEDINERO",body:"Transfiere y recibe dinero"},{title:"LABEL_MENUMAS_INT_RESPTRANSFIEREYRECIBEDINERO",body:"<p>Transfiere de manera simple y segura. Selecciona <b>Transferencia a terceros</b> y se desplegar\xe1 una lista con los contactos de tu tel\xe9fono o nuevos destinatarios para transferir a quien t\xfa quieras. S\xf3lo ingresa el monto y LISTO!</p><p>Tambi\xe9n podr\xe1s utilizar <b>PagoRUT</b>, el cual te permite pagar y cobrar de forma f\xe1cil a los clientes de BancoEstado que usen la aplicaci\xf3n.</p>"},{title:"LABEL_MENUMAS_INT_PAGATUSCUENTAS",body:"Paga tus cuentas y productos del banco"},{title:"LABEL_MENUMAS_INT_RESPPAGATUSCUENTAS",body:"<p>Paga tus productos o cuentas de servicios desde la comodidad de tu celular. Ingresa a la secci\xf3n PAGOS y selecciona el producto o el servicio a pagar.</p><p>Recuerda que por el momento la inscripci\xf3n de nuevas cuentas de servicio s\xf3lo se puede realizar en nuestro sitio web BancoEstado Estas transacciones no tienen costos adicionales por usar tu APP.</p>\r\n"},{title:"LABEL_MENUMAS_INT_RECARGATUBIP",body:"Recarga tu Bip! y la de qui\xe9n tu quieras "},{title:"LABEL_MENUMAS_INT_RESPRECARGATUBIP",body:"<p>Para recargar ingresa el n\xfamero de <b>Bip!</b> o escanea el c\xf3digo de barras, ingresa el monto, selecciona la cuenta con que pagar\xe1s (Cuenta Corriente, Chequera Electr\xf3nica o CuentaRUT) y recarga. Luego activas este saldo validando en cualquier t\xf3tem o infobip y listo!</p> <p>Recuerda que por el momento no es posible recargar tarjetas de otros bancos.</p>"},{title:"LABEL_MENUMAS_INT_DUDASDETUAPP",body:"Dudas de tu App u otro tema"},{title:"LABEL_MENUMAS_INT_RESPDUDASDETUAPP",body:"<p>Para m\xe1s consultas, revisa nuestro centro de ayuda en:</p>\r\n"}]}}]);